tables.table_schema:
CREATE TABLE website_metrics (
    website_id INT PRIMARY KEY,
    website_url VARCHAR(255),
    loading_speed INT,
    uptime_percentage FLOAT
);

CREATE TABLE seo_metrics (
    website_id INT PRIMARY KEY,
    organic_traffic INT,
    bounce_rate FLOAT,
    page_views INT
);

CREATE TABLE website_metrics (
    website_id INT,
    page_url VARCHAR,
    loading_time FLOAT,
    http_status_code INT
);

CREATE TABLE seo_metrics (
    page_url VARCHAR,
    seo_score FLOAT,
    keyword VARCHAR,
    ranking INT
);

CREATE TABLE website_pages (
    page_id INT PRIMARY KEY,
    page_url VARCHAR(255) NOT NULL,
    loading_time_sec FLOAT NOT NULL
);

CREATE TABLE seo_metrics (
    metric_id INT PRIMARY KEY,
    page_id INT REFERENCES website_pages(page_id),
    seo_score FLOAT NOT NULL,
    organic_traffic INT
);

CREATE TABLE user_activity (
    activity_id INT PRIMARY KEY,
    page_id INT REFERENCES website_pages(page_id),
    user_id INT NOT NULL,
    timestamp TIMESTAMP
);

CREATE TABLE performance_logs (
    log_id INT PRIMARY KEY,
    page_id INT REFERENCES website_pages(page_id),
    response_time_ms INT NOT NULL,
    error_code INT
);

CREATE TABLE website_performance_metrics (
    website_id INT PRIMARY KEY,
    load_time DECIMAL,
    page_views INT,
    bounce_rate DECIMAL
);

CREATE TABLE seo_metrics (
    website_id INT PRIMARY KEY,
    organic_traffic INT,
    ranking_position INT
);

CREATE TABLE user_demographics (
    user_id INT PRIMARY KEY,
    age INT,
    gender VARCHAR(10),
    location VARCHAR(50)
);

CREATE TABLE user_interactions (
    interaction_id INT PRIMARY KEY,
    user_id INT,
    timestamp TIMESTAMP,
    interaction_type VARCHAR(20)
);

CREATE TABLE website_errors (
    error_id INT PRIMARY KEY,
    website_id INT,
    error_message VARCHAR(255),
    error_timestamp TIMESTAMP
);
